import React from "react";
import "../../styles/about.css";

const About = () => {
    return <section id="about">
        <div className="container">
            <div className="about_wrapper">
                <div className="about_content"></div>

                <div className="about_img"></div>
            </div>
        </div>
    </section>
};

export default About
